import * as ACTION_TYPES from './action_types';

export const ADD_USERS = data => {
	return {
		type: ACTION_TYPES.ADD_USERS,
		payload: data
	};
};

export const FIELD = (name, value) => {
	return {
		type: ACTION_TYPES.FIELD,
		fieldName: name,
		payload: value
	};
};
